column8:
ツートンカラー ハンドルカバー　Sサイズ<BR><BR>
ハンドルカバーを変えて簡単コーデを楽しもう！！<BR><BR>
内装カラーに合わせて選べる。<BR>ハンドルカバーを変えるだけで内装イメージが変わる。<BR><BR><BR>

適合ステアリング外径（約）…３６ｃｍ～３８ｃｍ<BR><BR>
ＰＶＣレザー製×ビニールコーティング仕上げ<BR><BR>


【適合車種】
<p>・軽自動車：ワゴンR/ラパン/パレット/エブリイ/MRワゴン/スイフト/タント/ムーヴ/アトレー/ミラ/ミライース/ライフ/バモス/NBOX/ekワゴン/ekスポーツ/アイ/スピアーノ/AZワゴン/スクラムワゴン/ルークス/モコ/オッティー/などの軽自動車全般</p>
<p>・普通車：bB/キューブ/マーチ/フィット/インサイト/デミオ/ゼストなどの普通車</p>
<p>・ミニバン：ノア、ヴォクシー、ウィッシュ、セレナ、ステップワゴン、フリードなど</p>

※上記車種はあくまでも参考です。<br>
グレードにより異なる場合がありますので、必ずあらかじめお客様のお車の直径（外側から外側までの長さ）をお調べいただき、ご確認の上ご利用下さい。<br>
ハンドルはズレたりしないよう、フィット感を重視しピッタリと安全性を考慮して作られています。<br>
<BR>

＜ご注意＞
※Ｓサイズ設計の為、ステアリングサイズ及び形状等により装着困難な場合があります。<BR>
※商品はステアリングカバー１本での販売となります。<BR>
※画像はイメージ写真となります。お車により装着イメージ等は異なります。<br>







